        return new Source("{% extends 'base.html.twig' %}

{# {% block title %}Log in!{% endblock %} #}

{% block body %}
<form class=\"form\" method=\"post\">
    {% if error %}
        <p>{{ error.messageKey|trans(error.messageData, 'security') }}</p>
    {% endif %}

    {% if app.user %}
        <div>
            <a href=\"{{ path('app_logout') }}\"><button>Se déconnecter</button></a>
        </div>
    {% else %}
    <div class=\"form_box\">
        <h1 class=\"h3 mb-3 font-weight-normal\">Connectez-vous !</h1>
        <label for=\"inputPseudo\">Pseudo</label>
        <input type=\"text\" value=\"{{ last_username }}\" name=\"pseudo\" id=\"inputPseudo\" class=\"form-control\" autocomplete=\"username\" required autofocus>
        <label for=\"inputPassword\">Mot de passe</label>
        <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" autocomplete=\"current-password\" required>

        <input type=\"hidden\" name=\"_csrf_token\"
            value=\"{{ csrf_token('authenticate') }}\"
        >

        {#
            Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
            See https://symfony.com/doc/current/security/remember_me.html

            <div class=\"checkbox mb-3\">
                <label>
                    <input type=\"checkbox\" name=\"_remember_me\"> Remember me
                </label>
            </div>
        #}

        <p class=\"quote\"><i>admin : 123</i></p>
        <p class=\"quote\"><i>guest : 789</i></p>

        <button class=\"form_box_btn\" type=\"submit\">
            Connexion
        </button> 
    </div>
    {% endif %}
</form>
{% endblock %}
